Кейінірек Home немесе Assistant қолданбаларының параметрлері арқылы кез келген уақытта өзгерістер енгізе аласыз."

"Google Assistant-ке %1$s кеңістігіне қосылған жаңа әрі үйлесімді құрылғыларда сізге қатысты ақпарат беруге рұқсат етіңіз.

Жеке нәтижелер құрылғы түріне байланысты өзгеріп отырады және келесілерді қамтуы мүмкін:

• күнтізбе, электрондық пошта, фотосуреттер, контактілер және еске салғыштар;

• ұсыныстар (мысалы, YouTube бейнелері);

• жалғанған денсаулық және фитнес құрылғылары мен қызметтерінен алынған ақпарат;

• төлемдер жасау және контактілерге қоңырау шалу сияқты жеке әрекеттер.

