Жеке нәтижелерді сұрасаңыз, Assistant дауысыңызды таныған кезде жауап береді. Ал Assistant дауысыңызды танымаса, сұрау жауапсыз қалады.

Сіз сұрамасаңыз да, бұл құрылғыда жеке нәтижелер өз бетінше негізгі экранда көрсетіле береді және хабарландырулар түрінде шығарылады. Face Match функциясы қосылған құралғыларда бұл проактивті нәтижелер бетіңіз танылған кезде ғана көрсетіледі. Кез келген адам бұл жеке нәтижелерді көре, түрте және пайдалана алады, бірақ олардың қандай жағдайда көрсетілетінін Home немесе Assistant қолданбасының параметрлері арқылы реттеуіңізге болады.

Осы құрылғының алдында тұрған кез келген адам проактивті жекелендірілген ұсыныстарыңызды (мысалы, YouTube ұсыныстарын) көре алады."

